var bfCalculateDateTimeDifference=function(){"use strict";return function(e,t){const a=bfSplit(e,t),r=(a[0]||"today").trim(),s=(a[1]||"today").trim(),n=(a[2]||"days").trim(),o="undefined"!=typeof bfParseDateTime?bfParseDateTime(r):new Date(r),u="undefined"!=typeof bfParseDateTime?bfParseDateTime(s):new Date(s);if(["days","weeks","months","years"].includes(n)){const e=e=>new Date(e.getFullYear(),e.getMonth(),e.getDate()),t=e(o),a=e(u),r=a-t;switch(n){case"days":return Math.floor(r/864e5);case"weeks":return Math.floor(r/6048e5);case"months":{const e=t.getFullYear(),r=t.getMonth();return 12*(a.getFullYear()-e)+(a.getMonth()-r)}case"years":{const e=t.getFullYear();return a.getFullYear()-e}}}const f=u-o;switch(n.toLowerCase()){case"seconds":return Math.floor(f/1e3);case"minutes":return Math.floor(f/6e4);case"hours":return Math.floor(f/36e5);default:return Math.floor(f/864e5)}}}();
